    }

    return (
        <div className="landingPage"> 
            <h1 style={headerStyle}>
                SnapCode
            </h1>
            <Link to='/addCode'>
                <button style={buttonStyle} className="buttonStyles">
                    Get Started!
                </button>
            </Link>
        </div>        
    )
}

export default landingPage;
